from pptx import Presentation
from pptx.util import Pt, Inches
import random
import base64
from io import BytesIO  # Import BytesIO from io module

# Sample questions and answers with base64 encoded images
questions_and_answers = [
    ("What is the capital of France?", "Paris", "data:image/jpeg;base64,"),
    ("Who wrote 'To Kill a Mockingbird'?", "Harper Lee", "data:image/jpeg;base64,"),
    ("What is the chemical symbol for water?", "H2O", "data:image/jpeg;base64,")
]

# Function to create a slide with a question, answer, and image
def add_slide(prs, question, answer, image_base64):
    slide_layout = prs.slide_layouts[5]  # Assuming we are using a title and content layout
    slide = prs.slides.add_slide(slide_layout)

    shapes = slide.shapes

    # Set the title to the question
    title_shape = shapes.title
    title_shape.text = "Question: " + question

    # Add the image
    left_inch = Inches(5)
    top_inch = Inches(2)
    width_inch = Inches(3)
    height_inch = Inches(3)
    image_bytes = base64.b64decode(image_base64.split(',')[1])  # Extract and decode base64 data
    image_stream = BytesIO(image_bytes)
    pic = slide.shapes.add_picture(image_stream, left_inch, top_inch, width=width_inch, height=height_inch)

    # Add the answer as a text box
    left_inch = Inches(1)
    top_inch = Inches(2)
    width_inch = Inches(8)
    height_inch = Inches(1.5)
    txBox = slide.shapes.add_textbox(left_inch, top_inch, width_inch, height_inch)
    tf = txBox.text_frame
    p = tf.add_paragraph()
    p.text = "Answer: " + answer

    p.font.size = Pt(35)

# Create a presentation object
prs = Presentation("template.pptx")  # Load the template

# Identify the layout index for the "Lilac" slide layout
# You need to check the index of "Lilac" layout in your template
lilac_layout_idx = 0

# Add the "Lilac" slide as the first slide in the presentation
lilac_slide_layout = prs.slide_layouts[lilac_layout_idx]
lilac_slide = prs.slides.add_slide(lilac_slide_layout)
title_shape = lilac_slide.shapes.title
title_shape.text = "Lilac"  # Title of the slide

# Shuffle the questions and answers
random.shuffle(questions_and_answers)

# Add slides for each question-answer pair
for question, answer, image_base64 in questions_and_answers:
    add_slide(prs, question, answer, image_base64)

# Save the presentation
prs.save("random_quiz_with_lilac_encoded_images.pptx")
